    'help.WhatShouldIDoIfISuspectAFraudulentSeller_content': 'N\u1EBFu b\u1EA1n c\u1EA3m th\u1EA5y c\xF3 rao v\u1EB7t gi\u1EA3 m\u1EA1o ho\u1EB7c gian l\u1EADn, xin vui l\xF2ng li\xEAn h\u1EC7 v\u1EDBi ch\xFAng t\xF4i t\u1EA1i <<CONTACTLINK>>V\u1EA5n \u0111\u1EC1 ph\xE1p l\xFD<</CONTACTLINK>>.',
    'terms.BeforeSubmitting': 'Tr\u01B0\u1EDBc khi n\u1ED9p vui l\xF2ng \u0111\u1ECDc <<LINK_TERMS_USE>>\u0110i\u1EC1u kho\u1EA3n & \u0110i\u1EC1u ki\u1EC7n c\u1EE7a ch\xFAng t\xF4i.<</LINK_TERMS_USE>>',
