    'featured_listings.HowDoesItWork_New': '\u0110\u1ED1i v\u1EDBi danh s\xE1ch h\xE0ng \u0111\u1EA7u v\xE0 k\u1EBFt qu\u1EA3 t\xECm ki\u1EBFm c\u1EE7a Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u, Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u \u0111\u01B0\u1EE3c hi\u1EC3n th\u1ECB trong danh m\u1EE5c \xE1p d\u1EE5ng v\xE0 \u0111\u01B0\u1EE3c \u0111\u1ED5i th\u1EE9 t\u1EF1 ng\u1EABu nhi\xEAn trong s\u1ED1 t\u1EA5t c\u1EA3 c\xE1c qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u trong danh m\u1EE5c con v\xE0 v\u1ECB tr\xED. Trong m\u1ECDi tr\u01B0\u1EDDng h\u1EE3p, vi\u1EC7c l\u1EF1a ch\u1ECDn Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u \u0111\u01B0\u1EE3c t\u1EA1o ng\u1EABu nhi\xEAn \u0111\u1EC3 cho ph\xE9p ng\u01B0\u1EDDi mua Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u c\xF3 c\u01A1 h\u1ED9i \u0111\u01B0\u1EE3c xu\u1EA5t hi\u1EC7n tr\xEAn Trang web gi\u1ED1ng nh\u01B0 nhau. \u0110\xE2y l\xE0 l\xFD do m\xE0 qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n s\u1EBD kh\xF4ng xu\u1EA5t hi\u1EC7n li\xEAn t\u1EE5c trong ph\u1EA7n Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'L\xE0m th\u1EBF n\xE0o \u0111\u1EC3 t\xF4i c\xF3 th\u1EC3 mua Rao V\u1EB7t N\u1ED5i B\u1EADt?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'B\u1EA1n c\xF3 th\u1EC3 mua Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u trong b\u01B0\u1EDBc cu\u1ED1i c\xF9ng c\u1EE7a quy tr\xECnh \u0111\u0103ng m\xE0 x\xE1c nh\u1EADn r\u1EB1ng qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n d\xE3 \u0111\u01B0\u1EE3c \u0111\u0103ng tr\xEAn ho\u1EB7c t\u1EEB OLX. Quy tr\xECnh r\u1EA5t \u0111\u01A1n gi\u1EA3n. B\u1EA1n ch\u1ECDn s\u1ED1 tu\u1EA7n mu\u1ED1n \u0111\u0103ng ti\xEAu bi\u1EC3u qu\u1EA3ng c\xE1o. Sau \u0111\xF3 b\u1EA1n \u0111\u01B0\u1EE3c chuy\u1EC3n t\u1EDBi trang thanh to\xE1n c\xF3 c\xE1c l\u1EF1a ch\u1ECDn thanh to\xE1n. Sau khi thanh to\xE1n, b\u1EA1n s\u1EBD nh\u1EADn \u0111\u01B0\u1EE3c x\xE1c nh\u1EADn r\u1EB1ng qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n \u0111\xE3 s\u1EB5n s\xE0ng cho kho\u1EA3ng th\u1EDDi gian l\u1EF1a ch\u1ECDn. N\u1EBFu qu\u1EA3ng c\xE1o c\u1EE7a b\u1EA1n \u0111\xFAng v\u1EDBi c\xE1c \u0111i\u1EC1u kho\u1EA3n s\u1EED d\u1EE5ng c\u1EE7a OLX th\xEC b\u1EA1n s\u1EBD nh\u1EADn \u0111\u01B0\u1EE3c email x\xE1c nh\u1EADn. L\u01B0u \xFD r\u1EB1ng b\u1EA1n s\u1EBD kh\xF4ng \u0111\u01B0\u1EE3c ho\xE0n l\u1EA1i ti\u1EC1n sau khi \u0111\xE3 mua Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u. T\u1EA5t c\u1EA3 vi\u1EC7c mua b\xE1n Qu\u1EA3ng c\xE1o ti\xEAu bi\u1EC3u l\xE0 chung cu\u1ED9c.',
