    'featured_listings.HowMuchVisitsWillIncrease_content': 'M\u1EE5c \u0111\xEDch c\u1EE7a Rao V\u1EB7t N\u1ED5i B\u1EADt l\xE0 \u0111\u1EC3 l\xE0m t\u0103ng m\u1EE9c \u0111\u1ED9 hi\u1EC3n th\u1ECB c\u1EE7a rao v\u1EB7t c\u1EE7a b\u1EA1n.<br />C\xE1c k\u1EBFt qu\u1EA3 t\u1EEB nghi\xEAn c\u1EE9u n\u1ED9i b\u1ED9 cho th\u1EA5y v\u1EDBi Rao V\u1EB7t N\u1ED5i B\u1EADt trung b\xECnh s\u1ED1 ng\u01B0\u1EDDi nh\xECn th\u1EA5y rao v\u1EB7t c\u1EE7a b\u1EA1n<strong> t\u0103ng g\u1EA5p 8 l\u1EA7n so v\u1EDBi rao v\u1EB7t th\xF4ng th\u01B0\u1EDDng</strong>. Trong c\xE1c nh\xF3m c\xF3 nhi\u1EC1u rao v\u1EB7t th\xEC m\u1EE9c \u0111\u1ED9 hi\u1EC3n th\u1ECB c\u1EE7a b\u1EA1n c\xF3 th\u1EC3 l\xE0 20 l\u1EA7n.',
    'featured_listings.IDontSeeMyListingInFeaturedListings': 'T\xF4i kh\xF4ng nh\xECn th\u1EA5y rao v\u1EB7t c\u1EE7a t\xF4i trong khu v\u1EF1c Rao V\u1EB7t N\u1ED5i B\u1EADt',
    'featured_listings.IDontSeeMyListingInFeaturedListings_content': 'N\u1EBFu b\u1EA1n mua Rao V\u1EB7t N\u1ED5i B\u1EADt  v\xE0 kh\xF4ng nh\xECn th\u1EA5y n\xF3 trong khu v\u1EF1c \u0111\xE3 \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF th\xEC vui l\xF2ng:<br /><ul><li>X\xE1c nh\u1EADn b\u1EA1n \u0111\xE3 nh\u1EADn \u0111\u01B0\u1EE3c email x\xE1c nh\u1EADn kh\u1EB3ng \u0111\u1ECBnh l\xE0 rao v\u1EB7t n\u1ED5i b\u1EADt c\u1EE7a b\u1EA1n \u0111\xE3 \u0111\u01B0\u1EE3c d\u1ECBch v\u1EE5 kh\xE1ch h\xE0ng th\xF4ng qua. C\xF3 th\u1EC3 m\u1EA5t 24 gi\u1EDD \u0111\u1EC3 Rao V\u1EB7t N\u1ED5i B\u1EADt \u0111\u01B0\u1EE3c th\xF4ng qua.</li><li>X\xE1c nh\u1EADn ng\xE0y b\u1EAFt \u0111\u1EA7u v\xE0 k\u1EBFt th\xFAc c\u1EE7a Rao V\u1EB7t N\u1ED5i B\u1EADt c\u1EE7a b\u1EA1n trong email x\xE1c nh\u1EADn.</li><li>H\xE3y nh\u1EDB r\u1EB1ng rao v\u1EB7t c\u1EE7a b\u1EA1n s\u1EBD "lu\xE2n phi\xEAn" v\u1EDBi c\xE1c rao v\u1EB7t kh\xE1c trong c\xF9ng nh\xF3m v\xE0 v\u1ECB tr\xED n\xEAn kh\xF4ng ph\u1EA3i l\xFAc n\xE0o b\u1EA1n c\u0169ng nh\xECn th\u1EA5y rao v\u1EB7t c\u1EE7a m\xECnh. Theo quy \u0111\u1ECBnh trong m\u1ED9t ng\xE0y s\u1EBD kh\xF4ng c\xF3 nhi\u1EC1u h\u01A1n 18 rao v\u1EB7t "lu\xE2n phi\xEAn" trong m\u1ED9t m\u1EE5c \u1EDF m\u1ED9t th\xE0nh ph\u1ED1 xu\u1EA5t hi\u1EC7n n\xEAn c\u1EE9 kho\u1EA3ng ba l\u1EA7n trang web t\u1EA3i m\u1EE5c Rao V\u1EB7t N\u1ED5i B\u1EADt th\xEC rao v\u1EB7t c\u1EE7a b\u1EA1n s\u1EBD xu\u1EA5t hi\u1EC7n m\u1ED9t l\u1EA7n \u1EDF v\u1ECB tr\xED cao nh\u1EA5t c\u1EE7a Danh s\xE1ch v\xE0 \u1EDF K\u1EBFt qu\u1EA3 t\xECm ki\u1EBFm.*</li><li>N\u1EBFu b\u1EA1n v\u1EABn th\u1EA5y c\xF3 l\u1ED7i th\xEC , <<CONTACTLINK>>h\xE3y li\xEAn h\u1EC7 v\u1EDBi Nh\xF3m d\u1ECBch v\u1EE5 kh\xE1ch h\xE0ng c\u1EE7a ch\xFAng t\xF4i<</CONTACTLINK>>.</li></ul>',
